import{_ as o,c as a,o as i,ai as n}from"./chunks/framework.CLGT5cy9.js";const h=JSON.parse('{"title":"ReefModEngine.jl","description":"","frontmatter":{},"headers":[],"relativePath":"index.md","filePath":"index.md","lastUpdated":null}'),t={name:"index.md"};function r(s,e,l,d,p,c){return i(),a("div",null,[...e[0]||(e[0]=[n('<h1 id="ReefModEngine.jl" tabindex="-1">ReefModEngine.jl <a class="header-anchor" href="#ReefModEngine.jl" aria-label="Permalink to &quot;ReefModEngine.jl {#ReefModEngine.jl}&quot;">​</a></h1><p>A Julia interface to the ReefMod Engine (RME) C++ API.</p><p>Targets RME v1.0, and provides some convenience functions to interact with the RME. All other functions are accessible via the <code>@RME</code> macro.</p><p>The RME library, accompanying dataset, and RME documentation has to be requested from RME developers.</p><h2 id="Preface" tabindex="-1">Preface <a class="header-anchor" href="#Preface" aria-label="Permalink to &quot;Preface {#Preface}&quot;">​</a></h2><p>ReefMod is a coral ecology model developed at the University of Queensland (UQ) with more than 20 years of development history. The original ReefMod model was written in MATLAB. ReefMod has been ported to C++ to address issues and concerns around computational efficiency. This port is referred to as the ReefMod Engine (RME).</p><p>This package, ReefModEngine.jl, provides a Julia interface to the RME, leveraging Julia&#39;s first-class language interoperability support. The package does the following</p><ul><li><p><strong>Exposes the RME engine C++ API</strong></p></li><li><p><strong>Provides a simpler API for setup result collection</strong> (optional)</p></li></ul><p>To avoid confusion, the following naming conventions are used when referring to each.</p><ul><li><p>The original MATLAB implementation is <em>always</em> referred to as ReefMod.</p></li><li><p>The C++ port, ReefMod Engine (RME), is referred to either as RME or its full name.</p></li><li><p>This package, ReefModEngine.jl, is <em>always</em> referred to by its full name.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This package does not implement ReefMod or ReefMod Engine. It is simply an interface to allow its use in Julia.</p><p>A copy of the ReefMod Engine is available on request from its current developers at UQ.</p></div>',11)])])}const u=o(t,[["render",r]]);export{h as __pageData,u as default};
